import './Card.css'
import PropTypes from 'prop-types'

const Card = ({ card }) => {
    return (
        <div className="card"> 
            { card }
        </div>
    )
}

Card.propTypes = {
    card: PropTypes.number || PropTypes.char
  };

export default Card;
